import React from 'react';
import ReactDom from 'react-dom';

const name = "saim khan"

ReactDom.render(
    <>
    <h1 contentEditable="true">wellcome to {name}</h1>
    <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fimages.unsplash.com%2Fphoto-1612151855475-877969f4a6cc%3Fixid%3DMnwxMjA3fDB8MHxzZWFyY2h8MXx8aGQlMjBpbWFnZXxlbnwwfHwwfHw%253D%26ixlib%3Drb-1.2.1%26w%3D1000%26q%3D80&imgrefurl=https%3A%2F%2Funsplash.com%2Fs%2Fphotos%2Fhd-image&tbnid=xE4uU8uoFN00aM&vet=12ahUKEwiAhbDgzsLxAhWUwYUKHVQPCHMQMygCegUIARDOAQ..i&docid=pEU77tdqT8sGCM&w=1000&h=563&q=image&ved=2ahUKEwiAhbDgzsLxAhWUwYUKHVQPCHMQMygCegUIARDOAQ"></img>

    </>,
    document.getElementById("root")

);
